import React, { useState } from "react";

const TransactionFormComponent = props => {
    const numRegex = /\D/;
    const [transactionSequenceNumber,setTransactionSequenceNumber] = useState(0);
    const handleOnChange = e => {
        console.log(e.target.value);
        setTransactionSequenceNumber(e.target.value.replace(e.target.value.match(numRegex),''));
    }
    return (
        <>
        <h4>transaction form</h4>
        <div className="X X-fd-column">
            <label htmlFor="source-account">Source Account: </label>
            <input type="text" name="source-account" />
        </div>
        <div className="X X-fd-column">
            <label htmlFor="transaction-sequence-number">Transaction Sequence Number: </label>
            <input type="number" name="transaction-sequence-number" min="0" onChange={handleOnChange} value={transactionSequenceNumber}/>
        </div>
        
    
        </>
    )
}
export default TransactionFormComponent;
